INSERT INTO `kh_articles` (`id`, `title`, `content`, `category_id`, `created`, `modified`) VALUES
(1, 'Мэндчилгээ', '<p style="text-align: center;"><img class="aligncenter  wp-image-587" src="http://web-site.mn/manaikhoroo/img/news/mayor.jpg" alt="Ulaanbaatar Mayor" /></p>\n<p style="text-align: center;">Нийслэлийн иргэд та бүхний амар амгаланг айлтган мэндчилье.</p>\n<p style="text-align: justify;">Гэр хороодын иргэдийнхээ амьдрах таатай орчинг бүрдүүлэх, гэр хороодод үзүүлж байгаа төрийн болон нийтийн үйлчилгээг шуурхай хүртээмжтэй хүргэх талаар нийслэлийн төр захиргааны байгууллагуудын зүгээс анхаарал хандуулан, тодорхой төсөл хөтөлбөрүүдийг хэрэгжүүлж байгаа билээ. Гэр хорооллыг дахин төлөвлөж тохилог орон сууцны хороолол болгох, дэд бүтэц бүхий амины орон сууцны хороолол болгох ажлууд иргэд та бүхний оролцоотой амжилттай хэрэгжиж байна.</p>\n<p style="text-align: justify;">Улаанбаатар хотын гэр хороодод иргэдийн оролцоотой газрын зураглал хийх төслийг Улаанбаатар хотын Захирагчийн ажлын алба Азийн сантай хамтран хэрэгжүүлсэн бөгөөд газрын зураглалыг хийхдээ тухайн хэсэг, хороонд оршин суух иргэд, хэсгийн ахлагч нарыг оролцуулан оршин суугаа нутаг дэвсгэрийн талаар бодитой мэдээллийг газар дээр нь цуглуулан гэр хорооллын өнөөгийн нөхцөл байдал, эрэлт, хэрэгцээ, шаардлага, нийтийн үйлчилгээ ямар түвшинд байгааг энгийн, ойлгомжтой, ил тод харагдахуйц байдлаар газрын зураглалд тусгасан нь энэхүү төслийн онцлог болсон юм.</p>\n<blockquote>\n<p>Нийслэл хотод болон гэр хороололд хийгдэх хөрөнгө оруулалтыг бодитой, үр дүнтэй төлөвлөх, төсвийн төсөл бэлтгэх зэрэг ажлуудад энэхүү газрын зураглалд тусгагдсан мэдээлэлүүд нь ихээхэн ач холбогдолтой бөгөөд холбогдох яам, агентлаг, тамгын газар, төр захиргааны байгууллагуудын албан хэрэгцээнд ашиглах гарын авлага, төлөвлөлтийн суурь зураглал болж байгаа юм.</p>\n</blockquote>\n<p style="text-align: justify;">Гэр хороонд оршин суугаа иргэдэд энэхүү зураглалын ач холбогдлыг ойлгуулах, сурталчлах, тэдний санал бодлыг сонсох, шийдвэр гаргах болон төлөвлөлт хийх шатанд оролцох боломжоор хангах зорилгоор &ldquo; Манай хороо&rdquo; цахим хуудсыг ажиллуулж байна. Нийслэлийн иргэд та бүхэн энэхүү цахим хуудсаар үйлчлүүлснээр тухайн оршин суугаа хорооныхоо автобусны зогсоол, засмал зам, худаг, сургууль, цэцэрлэг, ил, задгай хог хаягдал, байгалийн гамшигт өртөж болзошгүй аюултай бүс, гудамж, замын гэрэлтүүлэг , гэмт хэрэг зөрчил гарч болзошгүй цэг, цагдаагийн хэсэг, өрхийн эмнэлэг зэрэг хороодын нийгмийн дэд бүтэцтэй холбоотой мэдээллийг орон зайн хувьд зөв тодорхойлсон газрын зураглалаас авахаас гадна хүн амын нягтрал, нийтийн үйлчилгээний хүртээмж, хэрэгцээ шаардлагын талаар хороо, дүүрэг, хотын хэмжээнд харьцуулсан судалгаа, дүн шинжилгээтэй танилцах өргөн боломжоор хангагдаж байгаа юм.</p>\n<p style="text-align: justify;">Зураглалыг хийхэд оролцсон болон дэмжлэг үзүүлсэн гэр хорооны иргэд, хэсгийн ахлагчид, хорооны ажилтнууд болон нийслэлийн төр, захиргааны байгууллагуудын ажилтан, албан хаагчид, төрийн бус байгууллагууд, АНУ-ын Азийн сангийн ажилтан, зөвлөхүүдэд нийслэлийн иргэдийнхээ өмнөөс болон хувиасаа гүнээ талархал илэрхийлж байна.</p>\n<p style="text-align: center;">НИЙСЛЭЛИЙН ЗАСАГ ДАРГА&nbsp;БӨГӨӨД</p>\n<p style="text-align: center;">УЛААНБААТАР ХОТЫН&nbsp;ЗАХИРАГЧ</p>\n<p style="text-align: center;">Э.БАТ ҮҮЛ</p>', 6, '2014-12-07 15:09:59', '2014-12-30 13:17:32'),
(3, 'Сайншанд хотын Захирагчийн ажлын албаныхан туршлага солилцов', '<p style="text-align: justify;">Улаанбаатар хотын Захирагчийн ажлын албаны хэлтсүүдийн ажилтай Сайншанд хотын Захирагчийн ажлын албаныхан танилцаж туршлага солилцлоо. Уулзалтыг Захиргаа, санхүүгийн хэлтсийн дарга Э.Энхцэцэг нээж үг хэлж, 2013 онд Улаанбаатар хотын Захирагчийн ажлын албаны хийсэн үндсэн ажлуудыг танилцуулсан. Сайншанд хотын Захирагчийн ажлын албаныхан өөр өөрсдийн хариуцсан ажлын хүрээнд хэлтсүүдийн ажилтай танилцаж мэргэжилтнүүдтэй санал солилцсон. Мөн байгууллагын дотоод дүрэм журам, бичиг хэрэг боловсруулалт, хог хаягдлын шинэ менежмент, нохой устгал, цахим мэдээлэл солилцооны талаар тодруулж, цаашид хэрхэн хамтран ажиллах талаараа ярилцлаа</p>\r\n<p style="text-align: justify;"><img class="aligncenter size-full wp-image-611" src="http://manaikhoroo.ub.gov.mn/wp-content/uploads/2014/01/news-updates-17.png" alt="news-updates-16" width="704" height="318" /></p>', 2, '2014-12-07 15:14:33', '2014-12-07 15:14:33'),
(4, '“Нийтийн үйлчилгээний Улаанбаатар нэгтгэл”-ийн удирдлагууд сургалтанд хамрагдав', '<p style="text-align: justify;">Улаанбаатар хотын Захирагчийн ажлын албанаас харьяа &ldquo;Нийтийн үйлчилгээний Улаанбаатар нэгтгэл&rdquo;-ийн Төлөвлөлт эдийн засгийн хэлтсийнхэн болон удирдах ажилтнуудад хагас өдрийн сургалт зохион байгууллаа. Улаанбаатар хотын Захирагчийн ажлын албаны Захиргаа, санхүүгийн хэлтсийн дарга Э.Энхцэцэг, &ldquo;Үйл ажиллагааны зардал төлөвлөлт, ажлын байрны тодорхойлолт боловсруулах, зураг авалт хийх арга зүй&rdquo;, &ldquo;Байгууллагын бизнес төлөвлөгөө боловсруулах арга зүй, түүний гүйцэтгэл шалгуур үзүүлэлт&rdquo; сэдвээр Эрчим хүчний зохицуулах хорооны ажилтан Х.Эрдэнэчулуун нар сургалт явууллаа. Сургалтанд оролцогсод шинээр байгуулагдсан газрын ажилтнуудад гарын авлага болохуйц сайн сургалт боллоо хэмээн дүгнэж баярласанаа илэрхийллээ.</p>\r\n<p style="text-align: justify;"><img class="aligncenter size-full wp-image-610" src="http://manaikhoroo.ub.gov.mn/wp-content/uploads/2014/01/news-updates-16.png" alt="news-updates-16" width="704" height="318" /></p>', 2, '2014-12-07 15:14:59', '2014-12-07 15:14:59'),
(5, 'Гэр хорооллын иргэдийн усан хангамжийг шийдэв', '<p style="text-align: justify;">Гэр хорооллын иргэд өөрийн амьдарч буй орчноо сайжруулах санаачлага гарган, эрүүл аюулгүй орчинд амьдрах боломжоо өөрсдөө бүрдүүлж бүтээн байгуулалтын ажилд гар бие оролцож эхэлсэн. Энэ ажлын эхлэлийг Захирагчийн гэр хороолол дахь ажлын албад хэрэгжүүлж байгаа. Өнөөдөр Захирагчийн Наран дахь ажлын албанаас санаачлан СХД-ийн 30-р хороонд гүний худгийг сэргээн засварлаж оршин суугчдад нь хүлээлгэж өглөө. Энэ арга хэмжээнд Хотын ерөнхий менежер Б.Бадрал, Азийн сангийн төлөөлөгч Тирза Тиниссен, ЗАА-ны Захиргаа, санхүүгйин хэлтсийн дарга Э.Энхцэцэг албаны бусад хүмүүс оролцсон. Энэ гүний худгийг сэргээн засварлахаар &ldquo;Шинэ зуун гэр хорооллол&rdquo; ТББ 2 жил хөөцөлдсөн боловч ажил хэрэг болоогүй. Харин Захирагчийн Наран дахь ажлын алба нааштайгаар хүлээн авч ЗАА&mdash;нд уламжилснаар Азийн сангийн &ldquo;Гэр хорооллын иргэдийн санал санаачлагыг дэмжих сан&rdquo;-гаас санхүүжүүлснээр ашиглалтанд оруулсан. Нээлтийн үеэр оршин суугчид &ldquo;Гэр хороолол дундах энэ худаг бөглөрөөд 2 жил болсон учраас ашиглахаа болиод удсан, ажилгүйчүүд цугладаг газрын нэг байсан. Гэрийнхээ ойролцоо худагтай болж усан хангамжаа шийдсэндээ баяртай байна. Сэргээн засаж ашиглалтанд оруулах сургаар бид ажилд нь гар бие оролцсон. Төр засаг яг ийм ажилд хөрөнгө гаргах хэрэгтэй&rdquo; гэж байлаа.</p>\r\n<p style="text-align: justify;"><img class="aligncenter size-full wp-image-608" src="http://manaikhoroo.ub.gov.mn/wp-content/uploads/2013/12/news-updates-14.jpg" alt="news-updates-14" width="704" height="318" /></p>\r\n<p style="text-align: justify;"><img class="aligncenter size-full wp-image-609" src="http://manaikhoroo.ub.gov.mn/wp-content/uploads/2013/12/news-updates-15.jpg" alt="news-updates-15" width="704" height="318" /></p>', 2, '2014-12-07 15:15:42', '2014-12-07 15:15:42'),
(6, 'Зураглалын ач холбогдлын талаар ярилцлаа', '<p style="text-align: justify;">АНУ-ын Азийн сангийн Улаанбаатар хотын Гэр хорооллын нийтийн үйлчилгээг сайжруулах хөтөлбөрийн хүрээнд АНУ-ын Азийн сангийн Дэд Ерөнхийлөгч бөгөөд Үйл ажиллагаа хариуцсан Захирал хатагтай Сюзанн И.Сискэл Улаанбаатар хотын Захирагчийн Наран дахь ажлын албаны ажилтай танилцлаа.</p>\r\n<p style="text-align: justify;">Уулзалтанд УБ хотын ЗАА-ны удирдлага, Наран дахь ЗАА-ны дарга Ш.Эрдэнэтуяа,Азийн сангийн хөтөлбөр, Үйл ажиллагаа хариуцсан менежерТирза Теннисен, Захирагчийн ажлын албаны ахлах зөвлөх Скотт&nbsp; Макдональдс, Азийн сангийн хөтөлбөрийн зохицуулагч Н.Ариунаа нар болон хорооны Засаг дарга, хэсгийн ахлагч, иргэдийн төлөөлөл оролцлоо.</p>\r\n<p style="text-align: justify;">СХД-ийн 30-р хороонд байрлахгэр хорооллын иргэдийн санал, санаачилгыг дэмжих сангийн хөрөнгөөр сэргээн засварлаж ашиглалтанд оруулсан&nbsp; гүний худагтай танилцсан. 23-р хорооны Хамбын овоон дээр гарч гэр хорооллын орчныг өндөрлөг газраас хараад албан бус хогийн цэгээр явав. Үүний дараа тус хороонд амьдарч буй өрх толгойлсон эмэгтэйн гэрээр орж аж байдалтай нь танилцлаа.</p>\r\n<p style="text-align: justify;">СХД-ийн 7-р хорооны үер усны аюулд өртөж болзошгүй бүсээр явж үзсэн. Дараа нь УБ хотын Захирагчийн Наран дахь ажлын албаны байранд ирж 7-р хорооны зураглал хийсэн иргэд болон Захирагчийн ажлын албаныхантай зураглалын ач холбогдлын талаар харилцан ярилцаж санал бодлоо солилцлоо.</p>\r\n<p style="text-align: justify;"><img class="aligncenter size-full wp-image-607" src="http://manaikhoroo.ub.gov.mn/wp-content/uploads/2013/12/news-updates-13.jpg" alt="news-updates-13" width="704" height="318" /></p>', 2, '2014-12-07 15:16:12', '2014-12-07 15:16:12'),
(7, 'Иргэдийн оролцоотой газрын зураглал хийх нь яагаад чухал вэ? Хэрэглээ, ач холбогдол', '<p style="text-align: justify;">Хорооны түвшинд иргэдийн оролцоотой хийсэн газрын зураглалыг төрөл бүрийн бүлгийн хүмүүс янз бүрийн зорилгоор ашиглах боломжтой юм. Газрын зураглалын боломжит хэрэглээний заримаас дурьдвал:</p>\r\n<h4 style="text-align: justify;">ИРГЭД, ОРШИН СУУГЧДЫГ МЭДЭЭ, МЭДЭЭЛЛЭЭР ХАНГАХ</h4>\r\n<p style="text-align: justify;">Иргэдийн оролцоотой хийгдсэн газрын зураглал нь нийтийн үйлчилгээний чанар, хүртээмжийг сайжруулахад чухал ач холбогдол бүхий мэдээ, мэдээллийн эх сурвалж болж болно. Газрын зураглалыг ашиглан иргэд, оршин суугчид өөрсдийн бодит хэрэгцээ, шаардлагын талаар шийдвэр гаргах түвшний албан тушаалтнуудад танилцуулж, ойлгуулах, тэдгээртэй илүү үр дүнтэй хэлэлцүүлэг өрнүүлэх боломжтой юм. Иргэд бодит мэдээ, мэдээлэл, баримт дээр үндэслэн өөрсдийн хэрэгцээ, шаардлагыг зөв тодорхойлж ойлгуулах ба нийтийн үйлчилгээний хүртээмж өөрсдийнх нь оршин сууж буй бүс нутаг болон хотын өөр бусад цэгүүдэд ямар байгаа талаар харьцуулсан дүн шинжилгээ хийж болох юм. Ингэснээр иргэд, оршин суугчид, оршин суугчдын бүлгүүд болон тухайн орон нутгийн засаг захиргаа, нийтийн үйлчилгээ үзүүлэгч байгууллага, аж ахуйн нэгжүүд хоорондын харилцаа холбоо сайжирч, үйлчилгээний чанар, хүртээмж дээшилнэ.</p>\r\n<h4 style="text-align: justify;">ИРГЭДИЙН ОРОЛЦООТОЙ ТӨЛӨВЛӨЛТ ХИЙХ ҮЙЛ ЯВЦАД ДЭМЖЛЭГ ҮЗҮҮЛЭХ</h4>\r\n<p style="text-align: justify;">Иргэдийн оролцоотой хийгдсэн газрын зураглалаар дамжуулан тухайн нэг орон нутгийн ирээдүйн хөгжлийн төлөвлөлтийг оновчтой хийх боломжтой юм. Жишээ нь, орон нутгийн хөгжлийн сангийн зарцуулалтыг шийдвэрлэхэд газрын зураглал ач холбогдолтой байж болно. Газрын зураглал дээрх мэдээлэл нь оролцогч талуудад тухайн хорооны нөхцөл байдалд үнэлэлт дүгнэлт өгч, бодит байдлыг зөвөөр ойлгох, асуудлыг ач холбогдлын хувьд эрэмбэлэн гаргаж ирэхэд тустай байдаг. Газрын зураглалыг ашиглан төрөл бүрийн нийтийн үйлчилгээний чанар, хүртээмжийн харилцан адилгүй түвшин, нийгмийн дэд бүтцийн байршил, хүртээмж зэргийг тодорхойлон гаргаж ирэх боломжтой юм. Төрийн болон хотын захиргааны холбогдох албан тушаалтнууд газрын зураглалыг ашиглан тухайн нэг бүс нутгийн иргэд, оршин суугчдын аж амьдрал, нөхцөл байдлын талаар илүү дэлгэрэнгүй олж мэдэж болох юм.</p>\r\n<h4 style="text-align: justify;">БОДИТ ТОО БАРИМТ ДЭЭР ҮНДЭСЛЭН НИЙТИЙН ҮЙЛЧИЛГЭЭГ САЙЖРУУЛАХ</h4>\r\n<p style="text-align: justify;">Газрын зураглал нь тухайн иргэд, оршин суугчдад хүрч буй нийтийн үйлчилгээний нөхцөл байдлын талаарх дэлгэрэнгүй, бодит тоо баримтыг харуулдаг бөгөөд ийм ч учраас газрын зураглалыг ашиглан аль нэг үйлчилгээний чанар, хүртээмжийг дээшлүүлэх чиглэлээр хэлэлцүүлэг өрнүүлэх боломжтой юм. Иргэд, оршин суугчид аль нэг асуудлын талаар хэлэлцүүлэг зохион байгуулахдаа тухайн орон нутгийн засаг захиргаа, нийтийн үйлчилгээ үзүүлэгч байгууллага, аж ахуйн нэгжийн төлөөллийг урин оролцуулж, асуудлыг хамтдаа шийдвэрлэх гарцыг хайх хэрэгтэй.</p>\r\n<p style="text-align: justify;">Ингэснээр дан ганц хотын захиргаа ч бус иргэд, оршин суугчид өөрсдийн боломж, мэдлэгээр асуудлыг шийдвэрлэхэд оролцох юм. Жишээ нь, хог хаягдлын менежментийг сайжруулах асуудал дээр оршин суугчид өөрсдөө хаана төвлөрсөн хогийн цэгүүдийг байршуулах нь тохиромжтой вэ гэдэг талаар болон албан бус хогийн цэгүүдэд хог хаях явдлыг иргэдийн оролцоотой хэрхэн, яаж хянах вэ гэдэг талаар өөрсдийн саналыг шийдвэр гаргах эрх бүхий хүмүүст ойлгуулж, асуудлыг шийдвэрлүүлэх боломжтой билээ.</p>\r\n<h4 style="text-align: justify;">ДҮҮРЭГ БОЛОН ХОТЫН ТҮВШИНД НИЙТИЙН ҮЙЛЧИЛГЭЭНИЙ ЧАНАР, ХҮРТЭЭМЖИЙГ САЙЖРУУЛАХ БОЛОН ГАЗАР ТӨЛӨВЛӨЛТ ХИЙХЭД АШИГЛАХ</h4>\r\n<p style="text-align: justify;">Хорооны түвшинд хийгдсэн газрын зураглалыг ашиглан дүүрэг, цаашлаад хотын түвшинд ч төлөвлөлт хийхэд ашиглах боломжтой юм. Газрын зураглалыг нэгтгэснээр хэд хэдэн хороодоос бүрдэх дүүргийн хүн ам зүй, нийгэм, эдийн засгийн нөхцөл байдлын талаарх илүү дэлгэрэнгүй зураглалыг олж харах боломжтой болох бөгөөд ингэснээр асуудлын уялдаа холбоо, харилцан хамаарлыг илүү ойлгомжтой байдлаар харах юм. Жишээ нь, дүүргийн хаана нийтийн үйлчилгээ доголдолтой байдаг болон шинээр шилжин ирэгсэдтэй холбоотой хаана үйлчилгээний хүртээмжийг нэмэгдүүлэх шаардлагатай вэ гэх мэт асуудлууд тодорхой харагдах болно. Газрын зураглал дээрх мэдээ, мэдээллийг цаг тухайд нь шинэчилсэнээр дүүргийн түвшинд нийтийн үйлчилгээний эрэлт, нийлүүлэлтэнд зохицсон оновчтой төлөвлөлтийг хийх боломжтой. Газрын зураглал дээр үндэслэн нийтийн үйлчилгээ үзүүлэгч байгууллага, аж ахуйн нэгжүүд мөн адил өөрсдийн үйлчилгээг иргэдэд илүү хүртээмжтэй, үр ашигтайгаар хүргэх арга замуудыг олж харах юм. Хороодын мэдээ, мэдээллийг нэгтгэснээр хорооны түвшинд харуулахад ач холбогдол багатай байсан мэдээлэл дүүргийн түвшинд илүү хэрэгцээтэй болж, илүү нарийн дүн шинжилгээ хийхэд туслаж болно. Жишээ нь, үер усны аюултай бүсийг хорооны түвшинд харахаас илүү дүүргийн түвшинд харсанаар илүү өргөн хүрээний арга хэмжээг авах боломжтой байж болно.</p>', 3, '2014-12-07 15:17:48', '2014-12-07 15:17:48'),
(8, 'Иргэдийн оролцоотой газрын зураглал гэж юу вэ?', '<p style="text-align: justify;">Иргэдийн оролцоотой газрын зураглал хийх ажлыг дэлхийн олон улс оронд иргэд, олон нийт гардан зохион байгуулдаг бөгөөд зураглалын гол давуу тал нь үүгээр дамжуулан иргэд өөрсдийн оршин сууж буй нутаг дэвсгэр, тэдгээрийн ахуй, аж амьдралтай холбоотой олон асуудлууд, тэр дундаа иргэдэд хүрч буй нийтийн үйлчилгээг зураглалаар дамжуулан харуулж болдогт орших юм. Газрын зураглал нь дан ганц иргэд, оршин суугчдын хэрэглэгдэхүүн болоод зогсохгүй тухайн орон нутгийн засаг захиргаа, холбогдох албан тушаалтнуудын ажилд ч дэмжлэг үзүүлэн, нийтийн үйлчилгээний чанар, хүртээмжийг сайжруулах чиглэлээр аль аль талдаа төлөвлөлт хийхэд түлхэц болдог. Иргэд бол өөрсдийн оршин сууж буй нутаг дэвсгэрийг хэнээс ч илүү сайн мэддэг учраас иргэдийн өөрсдийнх нь оролцоотой хийсэн газрын зураглалын тэдний бодит хэрэгцээ, шаардлагыг үнэн зөвөөр тусган харуулдаг.</p>\r\n<p style="text-align: justify;"><img class="aligncenter" src="http://farm8.staticflickr.com/7367/11426769753_09d6d0d16d_c.jpg" alt="" width="800" height="465" /></p>\r\n<p style="text-align: justify;">Нийслэлийн Захирагчийн ажлын алба, Азийн сангийн Улаанбаатар хотын Гэр хороолол дахь нийтийн үйлчилгээг сайжруулах хөтөлбөр, Улаанбаатар хотын гэр хорооллын Захирагчийн 10 ажлын албад, холбогдох хороодын Засаг дарга нар болон хэсгийн ахлагч нартай хамтран Улаанбаатар хотын нийт 11 хороонд иргэдийн оролцоотой газрын зураглал хийх туршилтын төслийг 2013 оны 05-07 дугаар сарын хооронд зохион байгуулж дуусаад байна. Энэхүү төслийн эхний шатны үр дүнг 2013 оны 08 дугаар сарын 05ны өдөр зохион байгуулагдсан уулзалт-хэлэлцүүлгийн үеэр Улаанбаатар хотын удирдлагуудад танилцуулсан билээ. Төслийн эхний шатны үр дүнтэй танилцсаны дараагаар Улаанбаатар хотын захиргааны зүгээс иргэдийн оролцоотой газрын зураглал хийх үйл явцыг цаашид үргэлжлүүлэн, нийт 78 хороонд нэмж зохион байгуулахаар санал тавьсан болно.</p>', 3, '2014-12-07 15:18:25', '2014-12-07 15:18:25'),
(9, 'Холбоо барих', '<div class="entry-content">\n<p>Захирагчийн ажлын алба<br />Хангарьд ордон 6 давхар<br />Имэйл: manaikhoroo@gmail.com<br />Утас: 326468; 323674</p>\n<h2>Улаанбаатар хот</h2>\n<p><a href="http://www.ulaanbaatar.mn/" target="_blank">ulaanbaatar.mn</a></p>\n<h2>Улаанбаатар хотын ЗАА</h2>\n<p><a href="http://ubservice.mn/" target="_blank">ubservice.mn</a></p>\n</div>', 4, '2014-12-15 02:22:33', '2014-12-15 02:22:33');
