INSERT INTO `kh_faq` (`id`, `title`, `content`) VALUES
(1, 'Хэрэглэгчийн заавар', '												Та бидэнд санал хүсэлт, өргөдөл гомдол илгээхийн тулд манай цахим системд бүртгүүлсэн байх шаардлагатай.<div><br></div><div><img src="http://niislel/webroot/img/faq/map.jpg" width:="" 300px;=""><br><div><br></div><div>Мөн манай цахим системд бүртгүүлснээр та нийслэл хотын газрын зураглал дээр тэмдэглэгээ нэмэх боломжтой болно.</div><div><br></div><div>Бүртгүүлэх товчин дээр дарж системд бүртгүүлнэ үү. &nbsp;</div>						</div>						'),
(2, 'Санал хүсэлт, зурган тэмдэглэгээ оруулах заавар', 'Санал хүсэлтийн заавар байрлана.');
